import React from "react";
import ReactDom from "react-dom";
import "./style.css";

const App = () => {
	return (
		<div>
			<h1 style={{ textAlign: "center" }}>Hello world</h1>
			<button className="button">Hey there!!</button>
		</div>
	);
}

ReactDom.render(<App />, document.getElementById("root"));
